import React from "react";

const navbar = () => {
  return (
    <nav className='bg-orange-500 flex flex-col md:flex-row justify-between items-center px-4 py-3'>
      <div>
        <span className='text-2xl text-gray-500 font-bold '>Local Market</span>
      </div>
      <ul className='flex flex-col md:flex-row  '>
        <li className="px-2 border py-2 border-gray-300 mr-2"><a href="">signup</a></li>
        <li className="px-2 border py-2 border-gray-300 mr-2"><a href="">order</a></li>
        <li className="px-2 border py-2 border-gray-300 mr-2"><a href="">transactions</a></li>
        <li className="px-2 border py-2 border-gray-300 mr-2"><a href="">signin</a></li>
        <li className="pl-2 border-gray-300 border py"><a href="">logout</a></li>
      </ul>
    </nav>
  );
};

export default navbar;
